import React from "react";
import "./table.css";

const TableHeader = ({ customColumns }) => {
    return (
        <thead>
            <tr>
                {customColumns.map((column, index) => (
                    <th key={index}>{column}</th>
                ))}
                <th>Action</th>
            </tr>
        </thead>
    );
};

export default TableHeader;
